import Link from 'next/link';

function Blog(){
    const title = 'Blog';
    return(
        <Layout>
            <ul>
                <li> Blog Post #1</li>
                <li> Blog Post #2</li>
                <li> Blog Post #3</li>
            </ul>
        </Layout>
    )
}
export default Blog;
